/*
 * 추상(abstract)
 * 추상클래스, 추상메소드
 * abstract class 클래스명
 * abstract void 메소드명(); 
 * 추상의 최상위클래스임.
 * 
 * 
 * 1.
 * 메소드가 완성되어지지 않은 것을 java에서는 추상이라한다.
 * 메소드가 완성되지 않았다는것은 클래스 또한 완전하지 못하다는 의미.
 * 
 * 2.
 * 메소드 오버라이딩의 강제성
 * 
 */


